-- Classes --

class 'JukeSpot'

function JukeSpot:__init(jukeSpotTable)

	self.paths = jukeSpotTable.paths

	self:CreatePathTimes()

	local longestPathN = 1

	for i=1, #self.paths do

		if self.paths[i][#self.paths[i]-1].timeToThisWaypoint + self.paths[i][#self.paths[i]-1].timeToCrossDistance > self.paths[longestPathN][#self.paths[longestPathN]-1].timeToThisWaypoint + self.paths[longestPathN][#self.paths[longestPathN]-1].timeToCrossDistance then

			longestPathN = i

		end

	end

	self.longestPathN = longestPathN

	self.treeCutSpots = jukeSpotTable.treeCutSpots

	self.hideSpots = jukeSpotTable.hideSpots

	self.center = jukeSpotTable.center[1]

	self.brushTable = {}

	self.treeCutEffectTable = {}

	self.hideSpotEffectTable = {}

	self.hasParticles = false

end

function JukeSpot:Update() 

	if me and GetDistance2D(me, self.center) < 1337 and not self.hasParticles then

		if performanceBrush then
			for i = 1, #self.paths do

				self.brushTable[i] = self:CreatePerformanceBrush({self.paths[i][1].x, self.paths[i][1].y, self.paths[i][1].z}, {self.paths[i][2].x, self.paths[i][2].y, self.paths[i][2].z})

			end
		else
			for i= 1, #self.paths do

				self.brushTable[i] = self:CreateBrush(self.paths[i][1].x, self.paths[i][1].y, self.paths[i][1].z) 

			end
		end

		for i = 1, #self.treeCutSpots do

			local x = self.treeCutSpots[i].x
			local y = self.treeCutSpots[i].y
			local z = self.treeCutSpots[i].z

			if treeCutSpotPingStatic then
				self.treeCutEffectTable[""..x..y..z..""] = Effect(Vector(x, y, z+100),"ping_static")
				self.treeCutEffectTable[""..x..y..z..""]:SetParameter( Vector(0, 255, 0) )
			else
				self.treeCutEffectTable[""..x..y..z..""] = Effect(Vector(x, y, z+250),"blueTorch_flame")
			end

		end

		for i = 1, #self.hideSpots do

			local x = self.hideSpots[i].x
			local y = self.hideSpots[i].y
			local z = self.hideSpots[i].z

			self.hideSpotEffectTable[""..x..y..z..""] = Effect(Vector(x, y, z+100),"ping_static")

		end


		self.startTick = GetTick()

		self.hasParticles = true

	elseif self.hasParticles and me and GetDistance2D(me, self.center) < 1337 then

		local paths = self.paths

		local startTick = self.startTick

		local longestPathN = self.longestPathN

		local curTick = GetTick()

		for pathn = 1, #paths do

			for waypointn = 1, #paths[pathn] do

				local nextWaypoint = paths[pathn][waypointn+1]

				if nextWaypoint then

					local thisWaypoint = paths[pathn][waypointn]

					if startTick + thisWaypoint.timeToThisWaypoint*1000 <= curTick and startTick + thisWaypoint.timeToThisWaypoint*1000 + thisWaypoint.timeToCrossDistance*1000 >= curTick then

						local distPercent = (1 - ((startTick + thisWaypoint.timeToThisWaypoint*1000 + thisWaypoint.timeToCrossDistance*1000) - curTick)/(thisWaypoint.timeToCrossDistance*1000))

						local x = thisWaypoint.x + thisWaypoint.distanceX * distPercent

						local y = thisWaypoint.y + thisWaypoint.distanceY * distPercent

						local z = thisWaypoint.z + thisWaypoint.distanceZ * distPercent

						if self.brushTable[pathn] ~= nil then
							if performanceBrush then
								self:MovePerformanceBrush(self.brushTable[pathn], {x, y, z}, {nextWaypoint.x, nextWaypoint.y, nextWaypoint.z})
							else
								self:MoveBrush(self.brushTable[pathn], x, y, z)
							end
						end

					end

				end

			end

			local longestWaypoint = paths[longestPathN][#paths[longestPathN]-1]

			if startTick + longestWaypoint.timeToThisWaypoint*1000 + longestWaypoint.timeToCrossDistance*1000 + 7000 < curTick then

				self.hasParticles = false

			end

		end	

	elseif self.hasParticles and GetDistance2D(me, self.center) > 1337 then

		self:RemoveEffects()

	end

end

function JukeSpot:RemoveEffects()

	for i = 1, #self.brushTable do

		self.brushTable[i] = nil

	end

	for i = 1, #self.treeCutSpots do

		self.treeCutEffectTable[""..self.treeCutSpots[i].x..self.treeCutSpots[i].y..self.treeCutSpots[i].z..""] = nil

		collectgarbage("collect")

	end

	for i = 1, #self.hideSpots do

		self.hideSpotEffectTable[""..self.hideSpots[i].x..self.hideSpots[i].y..self.hideSpots[i].z..""] = nil

		collectgarbage("collect")

	end

	self.hasParticles = false

end

function JukeSpot:CreateBrush(x, y, z)

	local effectTable = {}

	for i = 1, 21 do

		effectTable[#effectTable+1] = Effect(Vector(x + 17*cos(2*pi*i/21), y + 17*sin(2*pi*i/21), z + 1100), "draw_commentator")

	end

	for i = 1, #effectTable do

		effectTable[i]:SetParameter( Vector(red, green, blue) )

	end

	return effectTable

end

function JukeSpot:CreatePerformanceBrush(vectorOrigin, vectorDestination)

	local perpendicularRad = atan2((vectorDestination[1] - vectorOrigin[1])*-1, (vectorDestination[2] - vectorOrigin[2]))

	local x = vectorOrigin[1]

	local y = vectorOrigin[2]

	local z = vectorOrigin[3]

	local cosPerpendicularRad = cos(perpendicularRad)

	local sinPerpendicularRad = sin(perpendicularRad)

	local cosPerpendicularRadOpp = cosPerpendicularRad*-1

	local sinPerpendicularRadOpp = sinPerpendicularRad*-1

	local effectTable = {}

	local length = 25

	local size = 9

	for i = 1, size do

		effectTable[i] = Effect(Vector(x + (length/2)*cosPerpendicularRadOpp + length*(i/size)*cosPerpendicularRad, y + (length/2)*sinPerpendicularRadOpp + length*(i/size)*sinPerpendicularRad, z + 1100), "draw_commentator")

	end

	for i = 1, #effectTable do

		effectTable[i]:SetParameter( Vector(red, green, blue) )

	end

	return effectTable

end

function JukeSpot:MoveBrush(brush, x, y, z)

	for i = 1, #brush do

		brush[i]:SetPosition(Vector(x + 17*cos(2*pi*i/#brush), y + 17*sin(2*pi*i/#brush), z + 1100))

	end

end

function JukeSpot:MovePerformanceBrush(brush, vectorOrigin, vectorDestination)

	local perpendicularRad = atan2((vectorDestination[1] - vectorOrigin[1])*-1, (vectorDestination[2] - vectorOrigin[2]))

	local x = vectorOrigin[1]

	local y = vectorOrigin[2]

	local z = vectorOrigin[3]

	local cosPerpendicularRad = cos(perpendicularRad)

	local sinPerpendicularRad = sin(perpendicularRad)

	local cosPerpendicularRadOpp = cosPerpendicularRad*-1

	local sinPerpendicularRadOpp = sinPerpendicularRad*-1

	local length = 25

	for i = 1, #brush do

		brush[i]:SetPosition(Vector(x + (length/2)*cosPerpendicularRadOpp + length*(i/#brush)*cosPerpendicularRad, y + (length/2)*sinPerpendicularRadOpp + length*(i/#brush)*sinPerpendicularRad, z + 1100))

	end

end

function JukeSpot:CreatePathTimes()

	local paths = self.paths

	for pathn = 1, #paths do

		local timeToThisWaypoint = 0

		for waypointn = 1, #paths[pathn] do

			local nextWaypoint = paths[pathn][waypointn+1]

			if nextWaypoint then

				local thisWaypoint = paths[pathn][waypointn]

				local distance = GetDistance2D({x = thisWaypoint.x, y = thisWaypoint.y, z = thisWaypoint.z}, {x = nextWaypoint.x, y = nextWaypoint.y, z = nextWaypoint.z})

				self.paths[pathn][waypointn].distanceX = nextWaypoint.x - thisWaypoint.x

				self.paths[pathn][waypointn].distanceY = nextWaypoint.y - thisWaypoint.y

				self.paths[pathn][waypointn].distanceZ = nextWaypoint.z - thisWaypoint.z

				self.paths[pathn][waypointn].timeToCrossDistance = distance / 500

				timeToThisWaypoint = timeToThisWaypoint + thisWaypoint.timeToCrossDistance

				self.paths[pathn][waypointn].timeToThisWaypoint = timeToThisWaypoint

			end

		end

	end

end

-- Functions --

function OnLoad()

	if #entityList:FindEntities({type=TYPE_HERO}) < #entityList:FindEntities({classId=CDOTAPlayer}) then
		heroSelect = true
		injectedMidMatch = false
	elseif injectedMidMatch == true then
		injectedMidMatch = false
		return true
	end
	
	if #entityList:FindEntities({type=TYPE_HERO}) == #entityList:FindEntities({classId=CDOTAPlayer}) and heroSelect == true then
		heroSelect = false
		return true
	end
	
	return false

end

function PlayingGame()

	if not engineClient.ingame or engineClient.console then
		return false
	else
		return true
	end

end

function hasTreeConsumableItem(hero)

	for i = 1, 6 do
		if hero:HasItem(i) then
			local item = hero:GetItem(i)
			if item and (item.name == "item_quelling_blade" or item.name == "item_tango") then
				return true
			end
		end
	end

	return false

end

function GetDistance2D(a, b)

	return sqrt(pow(a.x - b.x, 2) + pow(a.y - b.y, 2))

end

-- Events --

function OnLoadTick()

	if not PlayingGame() then
		return
	end

	if OnLoad() then

		print("ShowJukePaths: Loaded!")

		if #jukeSpotClasses == 0 then

			for i = 1, #jukeSpotTables do

				jukeSpotClasses[#jukeSpotClasses+1] = JukeSpot(jukeSpotTables[i])

			end

		end

		script:RegisterEvent(EVENT_TICK, MainTick)

	end

end

function MainTick(tick)

	if not PlayingGame() then
		return
	end

	local hasTreeConsumableItem = hasTreeConsumableItem(me)

	for i = 1, #jukeSpotClasses do

		if #jukeSpotClasses[i].treeCutSpots == 0 or hasTreeConsumableItem then

			jukeSpotClasses[i]:Update()

		elseif jukeSpotClasses[i].hasParticles then

			jukeSpotClasses[i]:RemoveEffects()

		end

	end

end

script:RegisterEvent(EVENT_TICK, OnLoadTick)
